// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

// import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/utils/cryptography/ECDSA.sol";
import "@openzeppelin/contracts/utils/cryptography/draft-EIP712.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";

contract KwikTrustNFT is ERC721URIStorage, EIP712, AccessControl {
    // Roles
    bytes32 public constant VALIDATOR_ROLE = keccak256("VALIDATOR_ROLE");
    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");

    // Signing domains
    string private constant SIGNING_DOMAIN = "KwikTrust-Voucher";
    string private constant SIGNATURE_VERSION = "1";

    // variable declarations
    uint256 private tokenId;

    struct NFTVoucher {
        string uri;
        uint256 price;
        bytes signature;
        IERC20 token;
        address _marketplace;
        address _signer;
    }

    event HandleMint(address _minter, uint256 id);
    event HandleBulkMint(address _minter, uint256 id);
    event HandleLazyMint(
        address signer,
        address minter,
        string uri,
        uint256 tokenId
    );

    /**
     * @dev check the user has MINTER_ROLE
     * @param _name Name of Smart Contract
     * @param _symbol Symbol
     * @param _address Admin role
     * @param _validator Lazy minting validator Role
     */

    // constructor
    constructor(
        string memory _name,
        string memory _symbol,
        address _address,
        address _validator
    ) ERC721(_name, _symbol) EIP712(SIGNING_DOMAIN, SIGNATURE_VERSION) {
        _setupRole(DEFAULT_ADMIN_ROLE, _address);
        _setupRole(MINTER_ROLE, _address);
        _setupRole(VALIDATOR_ROLE, _validator);
    }

    /**
     * @dev nft minting
     * @param _tokenURI NFT URI
     * @param marketplace NFT Marketplace contract address
     */

    function mint(string memory _tokenURI, address marketplace)
        external
        onlyRole(MINTER_ROLE)
        returns (uint256)
    {
        tokenId++;
        _safeMint(msg.sender, tokenId);
        _setTokenURI(tokenId, _tokenURI);
        setApprovalForAll(marketplace, true);
        emit HandleMint(msg.sender, tokenId);
        return tokenId;
    }

    /**
     * @dev nft minting
     * @param _tokenURI NFT URI
     * @param marketplace NFT Marketplace contract address
     */

    function bulkMint(string[] memory _tokenURI, address marketplace)
        external
        onlyRole(MINTER_ROLE)
        returns (uint256)
    {
        for (uint256 i = 0; i < _tokenURI.length; i++) {
            tokenId++;
            _safeMint(msg.sender, (tokenId));
            _setTokenURI((tokenId), _tokenURI[i]);
            setApprovalForAll(marketplace, true);
        }
        emit HandleBulkMint(msg.sender, tokenId);
        return tokenId;
    }

    /**
     * @dev nft minting
     * @param _uri Token URI
     * @param _price Price of NFT
     * @param _signature signature of lazy minted NFT
     * @param _token ERC20: token address
     * @param _marketplace NFT Marketplace contract address
     * @param _signer signer's address
     * @dev Error Details
     * - 0x03: check VALIDATOR_ROLE
     */

    function lazyMint(
        string memory _uri,
        uint256 _price,
        string memory _signature,
        IERC20 _token,
        address _marketplace,
        address _signer
    ) public returns (uint256) {
        bytes memory signature = bytes(_signature);
        NFTVoucher memory voucher = NFTVoucher(
            _uri,
            _price,
            signature,
            _token,
            _marketplace,
            _signer
        );
        address verifyValidator = _verify(voucher);
        require(hasRole(VALIDATOR_ROLE, verifyValidator), "0x03");
        tokenId++;
        _safeMint(_signer, tokenId);
        _setTokenURI(tokenId, voucher.uri);
        _transfer(_signer, msg.sender, tokenId);
        IERC20(voucher.token).transferFrom(msg.sender, _signer, voucher.price);
        setApprovalForAll(_marketplace, true);
        emit HandleLazyMint(_signer, msg.sender, voucher.uri, tokenId);
        return tokenId;
    }

    /**
     * @dev _hash, creating KECCAK hash of voucher
     * @param voucher struct: containing data of NFT
     */

    function _hash(NFTVoucher memory voucher) internal view returns (bytes32) {
        return
            _hashTypedDataV4(
                keccak256(
                    abi.encode(
                        keccak256(
                            "NFTVoucher(string uri,uint256 price,address token)"
                        ),
                        keccak256(bytes(voucher.uri)),
                        voucher.price,
                        voucher.token
                    )
                )
            );
    }

    /**
     * @dev _verify, returns the public key
     * @param voucher struct: containing data of NFT
     */

    function _verify(NFTVoucher memory voucher)
        internal
        view
        returns (address)
    {
        bytes32 digest = _hash(voucher);
        return ECDSA.recover(digest, voucher.signature);
    }

    function totalSupply() public view returns (uint256) {
        return tokenId;
    }

    /**
     * @dev supportsInterface
     * @param interfaceId interface id in bytes
     */

    function supportsInterface(bytes4 interfaceId)
        public
        view
        virtual
        override(AccessControl, ERC721)
        returns (bool)
    {
        return
            ERC721.supportsInterface(interfaceId) ||
            AccessControl.supportsInterface(interfaceId);
    }
}

